import { useState } from "react";
import { Home, Wallet, ClipboardList, Gift, Users, Settings, User, ChevronDown } from "lucide-react";

export default function Sidebar({ setSelectedOrder }) {
  const [showOrders, setShowOrders] = useState(false);

  return (
    <div className="w-64 p-4 border-r border-gray-700 flex flex-col gap-4">
      <h1 className="text-yellow-400 text-xl font-bold">BINANCE</h1>
      <nav className="flex flex-col gap-2">
        <button className="flex items-center gap-2 p-2 rounded-lg bg-gray-800"><Home /> Dashboard</button>
        <button className="flex items-center gap-2 p-2 rounded-lg hover:bg-gray-800"><Wallet /> Assets</button>
        
        {/* Orders Button with Dropdown */}
        <div>
          <button
            className="flex items-center justify-between w-full p-2 rounded-lg hover:bg-gray-800"
            onClick={() => setShowOrders(!showOrders)}
          >
            <span className="flex items-center gap-2"><ClipboardList /> Orders</span>
            <ChevronDown className={`transition-transform ${showOrders ? "rotate-180" : ""}`} />
          </button>
          {showOrders && (
            <div className="ml-6 mt-2 flex flex-col gap-2">
              <button className="p-2 rounded-lg hover:bg-gray-700" onClick={() => setSelectedOrder('spot')}>Spot Order</button>
              <button className="p-2 rounded-lg hover:bg-gray-700">Futures Order</button>
              <button className="p-2 rounded-lg hover:bg-gray-700">Margin Order</button>
              <button className="p-2 rounded-lg hover:bg-gray-700">P2P Order</button>
            </div>
          )}
        </div>

        <button className="flex items-center gap-2 p-2 rounded-lg hover:bg-gray-800"><Gift /> Rewards Hub</button>
        <button className="flex items-center gap-2 p-2 rounded-lg hover:bg-gray-800"><Users /> Referral</button>
        <button className="flex items-center gap-2 p-2 rounded-lg hover:bg-gray-800"><User /> Account</button>
        <button className="flex items-center gap-2 p-2 rounded-lg hover:bg-gray-800"><Settings /> Settings</button>
      </nav>
    </div>
  );
}
